import React from "react";

const About = () => {
  return (
    <div className="section">
      <h2>About Me</h2>
      <p>
        Hello! I'm <strong>Pooja</strong>, a software developer passionate
        about building modern web applications.  
        I have expertise in <strong>Java, React, SQL</strong>, and more.  
        Always eager to learn and create efficient solutions!
      </p>
    </div>
  );
};

export default About;
